import PlayerList from "./PlayerList";

function Team({ city, mascot, wins, theme, rosters, login, user }) {

    const limitTeam = rosters.map((roster) => {
        if (roster.coach.id === user){
            return (
                <div key={roster.id} className="teamrosters">
                    <p>Year: {roster.year} </p>
                    <p>Level of Competition: {roster.level} </p>
                    <p>Coach Name: {roster.coach.first_name} {roster.coach.last_name} </p>
                    <p>Players: </p>
                        <PlayerList
                            key={roster.id}
                            players={roster.players}
                        />
                </div>
            )
        }
    })


    return (
        <div className="teamcontainer">
            <ul>
                {rosters.map((roster) => (
                        <div key={roster.id} className="teamrosters">
                        <p>Year: {roster.year} </p>
                        <p>Level of Competition: {roster.level} </p>
                        <p>Coach Name: {roster.coach.first_name} {roster.coach.last_name} </p>
                        <p>Players: </p>
                            <PlayerList
                                key={roster.id}
                                players={roster.players}
                            />
                        </div>
                    ))}
            </ul>
            <ul>
                <p>Team Name: {city} {mascot} </p>
                <p>Team Wins: {wins} </p>
                <ul>
                    {rosters.map((roster) => (
                        <div key={roster.id} className="teamrosters">
                        <p>Year: {roster.year} </p>
                        <p>Level of Competition: {roster.level} </p>
                        <p>Coach Name: {roster.coach.first_name} {roster.coach.last_name} </p>
                        <p>Players: </p>
                            <PlayerList
                                key={roster.id}
                                players={roster.players}
                            />
                        </div>
                    ))}
                </ul>
            </ul>
        </div>
    )
}

export default Team;
